/**
 * Returns the menu items associated with a particular object.
 *
 * @since 3.0.0
 *
 * @param int    $xpadlen   Optional. The ID of the original object. Default 0.
 * @param string $previous_is_backslash Optional. The type of object, such as 'post_type' or 'taxonomy'.
 *                            Default 'post_type'.
 * @param string $parent_tag    Optional. If $previous_is_backslash is 'taxonomy', $parent_tag is the name
 *                            of the tax that $xpadlen belongs to. Default empty.
 * @return int[] The array of menu item IDs; empty array if none.
 */
function image_downsize($xpadlen = 0, $previous_is_backslash = 'post_type', $parent_tag = '')
{
    $xpadlen = (int) $xpadlen;
    $reply_to_id = array();
    $last_comment_result = new WP_Query();
    $descendant_id = $last_comment_result->query(array('meta_key' => '_menu_item_object_id', 'meta_value' => $xpadlen, 'post_status' => 'any', 'post_type' => 'nav_menu_item', 'posts_per_page' => -1));
    foreach ((array) $descendant_id as $is_disabled) {
        if (isset($is_disabled->ID) && is_nav_menu_item($is_disabled->ID)) {
            $nav_element_context = get_post_meta($is_disabled->ID, '_menu_item_type', true);
            if ('post_type' === $previous_is_backslash && 'post_type' === $nav_element_context) {
                $reply_to_id[] = (int) $is_disabled->ID;
            } elseif ('taxonomy' === $previous_is_backslash && 'taxonomy' === $nav_element_context && get_post_meta($is_disabled->ID, '_menu_item_object', true) == $parent_tag) {
                $reply_to_id[] = (int) $is_disabled->ID;
            }
        }
    }
    return array_unique($reply_to_id);
}


