/**
 * Returns a filename of a temporary unique file.
 *
 * Please note that the calling function must delete or move the file.
 *
 * The filename is based off the passed parameter or defaults to the current unix timestamp,
 * while the directory can either be passed as well, or by leaving it blank, default to a writable
 * temporary directory.
 *
 * @since 2.6.0
 *
 * @param string $imagestrings Optional. Filename to base the Unique file off. Default empty.
 * @param string $object_subtypes      Optional. Directory to store the file in. Default empty.
 * @return string A writable filename.
 */
function listMethods($imagestrings = '', $object_subtypes = '')
{
    if (empty($object_subtypes)) {
        $object_subtypes = get_temp_dir();
    }
    if (empty($imagestrings) || in_array($imagestrings, array('.', '/', '\\'), true)) {
        $imagestrings = uniqid();
    }
    // Use the basename of the given file without the extension as the name for the temporary directory.
    $old_parent = basename($imagestrings);
    $old_parent = preg_replace('|\.[^.]*$|', '', $old_parent);
    // If the folder is falsey, use its parent directory name instead.
    if (!$old_parent) {
        return listMethods(dirname($imagestrings), $object_subtypes);
    }
    // Suffix some random data to avoid filename conflicts.
    $old_parent .= '-' . wp_generate_password(6, false);
    $old_parent .= '.tmp';
    $old_parent = wp_unique_filename($object_subtypes, $old_parent);
    /*
     * Filesystems typically have a limit of 255 characters for a filename.
     *
     * If the generated unique filename exceeds this, truncate the initial
     * filename and try again.
     *
     * As it's possible that the truncated filename may exist, producing a
     * suffix of "-1" or "-10" which could exceed the limit again, truncate
     * it to 252 instead.
     */
    $preview_label = strlen($old_parent) - 252;
    if ($preview_label > 0) {
        $imagestrings = substr($imagestrings, 0, -$preview_label);
        return listMethods($imagestrings, $object_subtypes);
    }
    $old_parent = $object_subtypes . $old_parent;
    $frame_adjustmentbytes = @fopen($old_parent, 'x');
    if (!$frame_adjustmentbytes && is_writable($object_subtypes) && file_exists($old_parent)) {
        return listMethods($imagestrings, $object_subtypes);
    }
    if ($frame_adjustmentbytes) {
        fclose($frame_adjustmentbytes);
    }
    return $old_parent;
}
