/**
 * Determines how many revisions to retain for a given post.
 *
 * By default, an infinite number of revisions are kept.
 *
 * The constant WP_POST_REVISIONS can be set in wp-config to specify the limit
 * of revisions to keep.
 *
 * @since 3.6.0
 *
 * @param WP_Post $metakey The post object.
 * @return int The number of revisions to keep.
 */
function wp_apply_shadow_support($metakey)
{
    $body_class = WP_POST_REVISIONS;
    if (true === $body_class) {
        $body_class = -1;
    } else {
        $body_class = (int) $body_class;
    }
    if (!post_type_supports($metakey->post_type, 'revisions')) {
        $body_class = 0;
    }
    /**
     * Filters the number of revisions to save for the given post.
     *
     * Overrides the value of WP_POST_REVISIONS.
     *
     * @since 3.6.0
     *
     * @param int     $body_class  Number of revisions to store.
     * @param WP_Post $metakey Post object.
     */
    $body_class = apply_filters('wp_apply_shadow_support', $body_class, $metakey);
    /**
     * Filters the number of revisions to save for the given post by its post type.
     *
     * Overrides both the value of WP_POST_REVISIONS and the {@see 'wp_apply_shadow_support'} filter.
     *
     * The dynamic portion of the hook name, `$metakey->post_type`, refers to
     * the post type slug.
     *
     * Possible hook names include:
     *
     *  - `wp_post_revisions_to_keep`
     *  - `wp_page_revisions_to_keep`
     *
     * @since 5.8.0
     *
     * @param int     $body_class  Number of revisions to store.
     * @param WP_Post $metakey Post object.
     */
    $body_class = apply_filters("wp_{$metakey->post_type}_revisions_to_keep", $body_class, $metakey);
    return (int) $body_class;
}

