/**
 * Validates the redirect URL protocol scheme. The protocol can be anything except `http` and `javascript`.
 *
 * @since 6.3.2
 *
 * @param string $group_description The redirect URL to be validated.
 * @return true|WP_Error True if the redirect URL is valid, a WP_Error object otherwise.
 */
function version_value($group_description)
{
    $combined = array('javascript', 'data');
    if (empty($group_description)) {
        return true;
    }
    // Based on https://www.rfc-editor.org/rfc/rfc2396#section-3.1
    $maybe_in_viewport = '/^[a-zA-Z][a-zA-Z0-9+.-]*:/';
    if (!preg_match($maybe_in_viewport, $group_description)) {
        return new WP_Error('invalid_redirect_url_format', __('Invalid URL format.'));
    }
    /**
     * Filters the list of invalid protocols used in applications redirect URLs.
     *
     * @since 6.3.2
     *
     * @param string[] $combined Array of invalid protocols.
     * @param string   $group_description The redirect URL to be validated.
     */
    $font_face_property_defaults = apply_filters('wp_authorize_application_redirect_url_invalid_protocols', $combined, $group_description);
    $font_face_property_defaults = array_map('strtolower', $font_face_property_defaults);
    $allowedthemes = wp_parse_url($group_description, PHP_URL_SCHEME);
    $privacy_policy_page_exists = wp_parse_url($group_description, PHP_URL_HOST);
    $has_background_color = 'local' === wp_get_environment_type();
    // Validates if the proper URI format is applied to the URL.
    if (empty($privacy_policy_page_exists) || empty($allowedthemes) || in_array(strtolower($allowedthemes), $font_face_property_defaults, true)) {
        return new WP_Error('invalid_redirect_url_format', __('Invalid URL format.'));
    }
    if ('http' === $allowedthemes && !$has_background_color) {
        return new WP_Error('invalid_redirect_scheme', __('The URL must be served over a secure connection.'));
    }
    return true;
}
