/**
 * Edit user settings based on contents of $_POST
 *
 * Used on user-edit.php and profile.php to manage and process user options, passwords etc.
 *
 * @since 2.0.0
 *
 * @param int $previous_monthnum Optional. User ID.
 * @return int|WP_Error User ID of the updated user or WP_Error on failure.
 */
function edit_user($previous_monthnum = 0)
{
    $box_id = wp_roles();
    $parse_whole_file = new stdClass();
    $previous_monthnum = (int) $previous_monthnum;
    if ($previous_monthnum) {
        $hsl_color = true;
        $parse_whole_file->ID = $previous_monthnum;
        $preview_button = get_userdata($previous_monthnum);
        $parse_whole_file->user_login = wp_slash($preview_button->user_login);
    } else {
        $hsl_color = false;
    }
    if (!$hsl_color && isset($_POST['user_login'])) {
        $parse_whole_file->user_login = sanitize_user(wp_unslash($_POST['user_login']), true);
    }
    $pass1 = '';
    $pass2 = '';
    if (isset($_POST['pass1'])) {
        $pass1 = trim($_POST['pass1']);
    }
    if (isset($_POST['pass2'])) {
        $pass2 = trim($_POST['pass2']);
    }
    if (isset($_POST['role']) && current_user_can('promote_users') && (!$previous_monthnum || current_user_can('promote_user', $previous_monthnum))) {
        $new_role = sanitize_text_field($_POST['role']);
        // If the new role isn't editable by the logged-in user die with error.
        $editable_roles = get_editable_roles();
        if (!empty($new_role) && empty($editable_roles[$new_role])) {
            wp_die(__('Sorry, you are not allowed to give users that role.'), 403);
        }
        $potential_role = isset($box_id->role_objects[$new_role]) ? $box_id->role_objects[$new_role] : false;
        /*
         * Don't let anyone with 'promote_users' edit their own role to something without it.
         * Multisite super admins can freely edit their roles, they possess all caps.
         */
        if (is_multisite() && current_user_can('manage_network_users') || get_current_user_id() !== $previous_monthnum || $potential_role && $potential_role->has_cap('promote_users')) {
            $parse_whole_file->role = $new_role;
        }
    }
    if (isset($_POST['email'])) {
        $parse_whole_file->user_email = sanitize_text_field(wp_unslash($_POST['email']));
    }
    if (isset($_POST['url'])) {
        if (empty($_POST['url']) || 'http://' === $_POST['url']) {
            $parse_whole_file->user_url = '';
        } else {
            $parse_whole_file->user_url = sanitize_url($_POST['url']);
            $protocols = implode('|', array_map('preg_quote', wp_allowed_protocols()));
            $parse_whole_file->user_url = preg_match('/^(' . $protocols . '):/is', $parse_whole_file->user_url) ? $parse_whole_file->user_url : 'http://' . $parse_whole_file->user_url;
        }
    }
    if (isset($_POST['first_name'])) {
        $parse_whole_file->first_name = sanitize_text_field($_POST['first_name']);
    }
    if (isset($_POST['last_name'])) {
        $parse_whole_file->last_name = sanitize_text_field($_POST['last_name']);
    }
    if (isset($_POST['nickname'])) {
        $parse_whole_file->nickname = sanitize_text_field($_POST['nickname']);
    }
    if (isset($_POST['display_name'])) {
        $parse_whole_file->display_name = sanitize_text_field($_POST['display_name']);
    }
    if (isset($_POST['description'])) {
        $parse_whole_file->description = trim($_POST['description']);
    }
    foreach (wp_get_user_contact_methods($parse_whole_file) as $method => $not_in) {
        if (isset($_POST[$method])) {
            $parse_whole_file->{$method} = sanitize_text_field($_POST[$method]);
        }
    }
    if (isset($_POST['locale'])) {
        $locale = sanitize_text_field($_POST['locale']);
        if ('site-default' === $locale) {
            $locale = '';
        } elseif ('' === $locale) {
            $locale = 'en_US';
        } elseif (!in_array($locale, get_available_languages(), true)) {
            if (current_user_can('install_languages') && wp_can_install_language_pack()) {
                if (!wp_download_language_pack($locale)) {
                    $locale = '';
                }
            } else {
                $locale = '';
            }
        }
        $parse_whole_file->locale = $locale;
    }
    if ($hsl_color) {
        $parse_whole_file->rich_editing = isset($_POST['rich_editing']) && 'false' === $_POST['rich_editing'] ? 'false' : 'true';
        $parse_whole_file->syntax_highlighting = isset($_POST['syntax_highlighting']) && 'false' === $_POST['syntax_highlighting'] ? 'false' : 'true';
        $parse_whole_file->admin_color = isset($_POST['admin_color']) ? sanitize_text_field($_POST['admin_color']) : 'fresh';
        $parse_whole_file->show_admin_bar_front = isset($_POST['admin_bar_front']) ? 'true' : 'false';
    }
    $parse_whole_file->comment_shortcuts = isset($_POST['comment_shortcuts']) && 'true' === $_POST['comment_shortcuts'] ? 'true' : '';
    $parse_whole_file->use_ssl = 0;
    if (!empty($_POST['use_ssl'])) {
        $parse_whole_file->use_ssl = 1;
    }
    $errors = new WP_Error();
    /* checking that username has been typed */
    if ('' === $parse_whole_file->user_login) {
        $errors->add('user_login', __('<strong>Error:</strong> Please enter a username.'));
    }
    /* checking that nickname has been typed */
    if ($hsl_color && empty($parse_whole_file->nickname)) {
        $errors->add('nickname', __('<strong>Error:</strong> Please enter a nickname.'));
    }
    /**
     * Fires before the password and confirm password fields are checked for congruity.
     *
     * @since 1.5.1
     *
     * @param string $parse_whole_file_login The username.
     * @param string $pass1     The password (passed by reference).
     * @param string $pass2     The confirmed password (passed by reference).
     */
    do_action_ref_array('check_passwords', array($parse_whole_file->user_login, &$pass1, &$pass2));
    // Check for blank password when adding a user.
    if (!$hsl_color && empty($pass1)) {
        $errors->add('pass', __('<strong>Error:</strong> Please enter a password.'), array('form-field' => 'pass1'));
    }
    // Check for "\" in password.
    if (str_contains(wp_unslash($pass1), '\\')) {
        $errors->add('pass', __('<strong>Error:</strong> Passwords may not contain the character "\".'), array('form-field' => 'pass1'));
    }
    // Checking the password has been typed twice the same.
    if (($hsl_color || !empty($pass1)) && $pass1 !== $pass2) {
        $errors->add('pass', __('<strong>Error:</strong> Passwords do not match. Please enter the same password in both password fields.'), array('form-field' => 'pass1'));
    }
    if (!empty($pass1)) {
        $parse_whole_file->user_pass = $pass1;
    }
    if (!$hsl_color && isset($_POST['user_login']) && !validate_username($_POST['user_login'])) {
        $errors->add('user_login', __('<strong>Error:</strong> This username is invalid because it uses illegal characters. Please enter a valid username.'));
    }
    if (!$hsl_color && username_exists($parse_whole_file->user_login)) {
        $errors->add('user_login', __('<strong>Error:</strong> This username is already registered. Please choose another one.'));
    }
    /** This filter is documented in wp-includes/user.php */
    $illegal_logins = (array) apply_filters('illegal_user_logins', array());
    if (in_array(strtolower($parse_whole_file->user_login), array_map('strtolower', $illegal_logins), true)) {
        $errors->add('invalid_username', __('<strong>Error:</strong> Sorry, that username is not allowed.'));
    }
    // Checking email address.
    if (empty($parse_whole_file->user_email)) {
        $errors->add('empty_email', __('<strong>Error:</strong> Please enter an email address.'), array('form-field' => 'email'));
    } elseif (!is_email($parse_whole_file->user_email)) {
        $errors->add('invalid_email', __('<strong>Error:</strong> The email address is not correct.'), array('form-field' => 'email'));
    } else {
        $owner_id = email_exists($parse_whole_file->user_email);
        if ($owner_id && (!$hsl_color || $owner_id !== $parse_whole_file->ID)) {
            $errors->add('email_exists', __('<strong>Error:</strong> This email is already registered. Please choose another one.'), array('form-field' => 'email'));
        }
    }
    /**
     * Fires before user profile update errors are returned.
     *
     * @since 2.8.0
     *
     * @param WP_Error $errors WP_Error object (passed by reference).
     * @param bool     $hsl_color Whether this is a user update.
     * @param stdClass $parse_whole_file   User object (passed by reference).
     */
    do_action_ref_array('user_profile_update_errors', array(&$errors, $hsl_color, &$parse_whole_file));
    if ($errors->has_errors()) {
        return $errors;
    }
    if ($hsl_color) {
        $previous_monthnum = wp_update_user($parse_whole_file);
    } else {
        $previous_monthnum = wp_insert_user($parse_whole_file);
        $notify = isset($_POST['send_user_notification']) ? 'both' : 'admin';
        /**
         * Fires after a new user has been created.
         *
         * @since 4.4.0
         *
         * @param int|WP_Error $previous_monthnum ID of the newly created user or WP_Error on failure.
         * @param string       $notify  Type of notification that should happen. See
         *                              wp_send_new_user_notifications() for more information.
         */
        do_action('edit_user_created_user', $previous_monthnum, $notify);
    }
    return $previous_monthnum;
}
