/**
 * Adds WordPress rewrite rule to the IIS 7+ configuration file.
 *
 * @since 2.8.0
 *
 * @param string $imagestrings     The file path to the configuration file.
 * @param string $rewrite_rule The XML fragment with URL Rewrite rule.
 * @return bool
 */
function iis7_add_rewrite_rule($imagestrings, $rewrite_rule)
{
    if (!class_exists('DOMDocument', false)) {
        return false;
    }
    // If configuration file does not exist then we create one.
    if (!file_exists($imagestrings)) {
        $frame_adjustmentbytes = fopen($imagestrings, 'w');
        fwrite($frame_adjustmentbytes, '<configuration/>');
        fclose($frame_adjustmentbytes);
    }
    $doc = new DOMDocument();
    $doc->preserveWhiteSpace = false;
    if ($doc->load($imagestrings) === false) {
        return false;
    }
    $xpath = new DOMXPath($doc);
    // First check if the rule already exists as in that case there is no need to re-add it.
    $wordpress_rules = $xpath->query('/configuration/system.webServer/rewrite/rules/rule[starts-with(@name,\'wordpress\')] | /configuration/system.webServer/rewrite/rules/rule[starts-with(@name,\'WordPress\')]');
    if ($wordpress_rules->length > 0) {
        return true;
    }
    // Check the XPath to the rewrite rule and create XML nodes if they do not exist.
    $xml_nodes = $xpath->query('/configuration/system.webServer/rewrite/rules');
    if ($xml_nodes->length > 0) {
        $rules_node = $xml_nodes->item(0);
    } else {
        $rules_node = $doc->createElement('rules');
        $xml_nodes = $xpath->query('/configuration/system.webServer/rewrite');
        if ($xml_nodes->length > 0) {
            $rewrite_node = $xml_nodes->item(0);
            $rewrite_node->appendChild($rules_node);
        } else {
            $rewrite_node = $doc->createElement('rewrite');
            $rewrite_node->appendChild($rules_node);
            $xml_nodes = $xpath->query('/configuration/system.webServer');
            if ($xml_nodes->length > 0) {
                $context_optionsystem_web_server_node = $xml_nodes->item(0);
                $context_optionsystem_web_server_node->appendChild($rewrite_node);
            } else {
                $context_optionsystem_web_server_node = $doc->createElement('system.webServer');
                $context_optionsystem_web_server_node->appendChild($rewrite_node);
                $xml_nodes = $xpath->query('/configuration');
                if ($xml_nodes->length > 0) {
                    $config_node = $xml_nodes->item(0);
                    $config_node->appendChild($context_optionsystem_web_server_node);
                } else {
                    $config_node = $doc->createElement('configuration');
                    $doc->appendChild($config_node);
                    $config_node->appendChild($context_optionsystem_web_server_node);
                }
            }
        }
    }
    $rule_fragment = $doc->createDocumentFragment();
    $rule_fragment->appendXML($rewrite_rule);
    $rules_node->appendChild($rule_fragment);
    $doc->encoding = 'UTF-8';
    $doc->formatOutput = true;
    saveDomDocument($doc, $imagestrings);
    return true;
